DROP TABLE IF EXISTS clientes;
CREATE TABLE clientes(
   id                       SERIAL  NOT NULL PRIMARY KEY
  ,nombre                   VARCHAR(11) NOT NULL
  ,primer_apellido          VARCHAR(10) NOT NULL
  ,segundo_apellido         VARCHAR(11) NOT NULL
  ,correo_electronico       VARCHAR(25) NOT NULL
  ,telefono                 INTEGER  NOT NULL
  ,empresa                  VARCHAR(8) NOT NULL
  ,cargo                    VARCHAR(21) NOT NULL
  ,provincia                VARCHAR(22) NOT NULL
  ,ciudad                   VARCHAR(26) NOT NULL
  ,direccion                VARCHAR(69) NOT NULL
  ,fecha_de_nacimiento      DATE  NOT NULL
  ,ultima_vez_contactado    DATE  NOT NULL
  ,pedidos                  INTEGER  NOT NULL
  ,importe_total_de_pedidos NUMERIC(7,2) NOT NULL
);
